                    '        # set the window size\n',
                    '        resize_scale = 450 / input_image.shape[1]\n',
                    '        windows_width = int(input_image.shape[1] * resize_scale)\n',
                    '        windows_height = int(input_image.shape[0] * resize_scale)\n',
