                    '\n',
                    '        skeleton = engine.Skeleton(body_edges=body_edges)\n',
                    '\n',
                    '        processing_times = collections.deque()\n',
                    '\n',
                    '        while True:\n',
                    '            # grab the frame\n',
                    '            frame = player.next()\n',
                    '            if frame is None:\n',
