                    '            pose[1] * frame.shape[0] / scaled_img.shape[0],\n',
                    '        )\n',
                    '\n',
                    '        # Draw joints.\n',
                    '        for edge in body_edges_2d:\n',
                    '            if was_found[edge[0]] and was_found[edge[1]]:\n',
                    '                cv2.line(\n',
                    '                    frame,\n',
