                    '\n',
                    'sam_result = mask_annotator.annotate(scene=np.zeros_like(image_bgr), detections=sam_detections)\n',
                    'fast_sam_result = mask_annotator.annotate(scene=np.zeros_like(image_bgr), detections=fast_sam_detections)\n',
