                'source': [
                    'masks = masks.cpu().numpy().astype(bool)\n',
                    'annotated_image=annotate_image(image_path=IMAGE_PATH, masks=masks)\n',
                    'sv.plot_image(image=annotated_image, size=(8, 8))'
                ]
