                    'masks = prompt_process.everything_prompt()\n',
                    'masks = masks.cpu().numpy().astype(bool)\n',
                    'xyxy = sv.mask_to_xyxy(masks=masks)\n',
                    'fast_sam_detections = sv.Detections(xyxy=xyxy, mask=masks)'
